import React from 'react'
import Product from './Product';
import ul_wlkp_6r_nads_pow from '../Pictures/ul_wlkp_6r_nads_pow.png'
import ul_wlkp_6r_nads_pow2 from '../Pictures/ul_wlkp_6r_nads_pow2.png'
import ul_wlkp_6r_nads_pow3 from '../Pictures/ul_wlkp_6r_nads_pow3.png'
import ul_miniplus from '../Pictures/ul_miniplus.png'

function BargainBarnItems() {
    return (
        <div className='store__products'>

            <Product
                id='ul_wlkp_6r'
                title='Ul odkładowy wielkopolski zwykły 6R'
                image='https://www.betterbee.com/images/toccs2017_n.jpg'
                price={70}
                availble={true}
            />

            <Product
                id='ul_wlkp_8r'
                title='Ul odkładowy wielkopolski zwykły 8R'
                image='https://scontent.fpoz3-1.fna.fbcdn.net/v/t1.15752-9/p1080x2048/103097755_187623812567883_3539773748852154901_n.jpg?_nc_cat=103&_nc_sid=b96e70&_nc_ohc=sqxz0LZLGNcAX_XX8ul&_nc_ht=scontent.fpoz3-1.fna&tp=6&oh=f0f07498a261791690df2703b4c84b6b&oe=5F96AD5D'
                price={75}
                availble={false}
            />

            <Product
                id='ul_wlkp_6r_nads'
                title='Ul odkładowy wielkopolski 6R z nadstawką'
                image='https://www.betterbee.com/images/toccs2017_n.jpg'
                price={105}
                availble={false}
            />

            <Product
                id='ul_wlkp_8r_nads'
                title='Ul odkładowy wielkopolski 8R z nadstawką'
                image='https://www.betterbee.com/images/toccs2017_n.jpg'
                price={110}
                availble={false}
            />

            <Product
                id='ul_wrsz_6r'
                title='Ul odkładowy warszawski zwykły 6R'
                image='https://scontent.fpoz3-1.fna.fbcdn.net/v/t1.15752-9/p1080x2048/120314803_986437631872861_6474462195189420680_n.jpg?_nc_cat=103&_nc_sid=b96e70&_nc_ohc=59KKth2-RiQAX9eu41v&_nc_ht=scontent.fpoz3-1.fna&tp=6&oh=deebf5e64829d9ad061c7f7f208ae28f&oe=5F9659B3'
                price={70}
                availble={false}
            />

            <Product
                id='ul_wrsz_8r'
                title='Ul odkładowy warszawski zwykły 8R'
                image='https://scontent.fpoz3-1.fna.fbcdn.net/v/t1.15752-9/p1080x2048/120352513_1682289745278784_929555445873554431_n.jpg?_nc_cat=109&_nc_sid=b96e70&_nc_ohc=Gc0tW8Lep6IAX-MB1Hr&_nc_ht=scontent.fpoz3-1.fna&tp=6&oh=8bc8722e7c3483077b6b63cc48eb225c&oe=5F95C7B6'
                price={75}
                availble={false}
            />

            <Product
                id='ul_dadnat_8r'
                title='Ul odkładowy dadant gniazdowy 8R'
                image='https://scontent.fpoz3-1.fna.fbcdn.net/v/t1.15752-9/p1080x2048/103266761_541314696565088_7797877033234766908_n.jpg?_nc_cat=104&_nc_sid=b96e70&_nc_ohc=QqvXhte_jW8AX-nxJHo&_nc_ht=scontent.fpoz3-1.fna&tp=6&oh=4e6cb015b6ff9e9ef4fcbcb23214a592&oe=5F9736BB'
                price={80}
                availble={false}
            />

            <Product
                id='ul_dadnat_nads'
                title='Ul odkładowy dadant gniazdowy z nadstawką'
                image='https://www.betterbee.com/images/toccs2017_n.jpg'
                price={110}
                availble={false}
            />

            <Product
                id='ul_dadnat__1/2_nads'
                title='Ul odkładowy dadant 1/2 z nadstawką'
                image='https://scontent.fpoz3-1.fna.fbcdn.net/v/t1.15752-9/p1080x2048/102722193_2754117161383995_7631478900761838267_n.jpg?_nc_cat=100&_nc_sid=b96e70&_nc_ohc=YZQXwP4MhvMAX_6D89_&_nc_ht=scontent.fpoz3-1.fna&tp=6&oh=28224738a0ecd1ae27e1e607c398e540&oe=5F981BA8'
                price={85}
                availble={false}
            />

            <Product
                id='ul_miniplus'
                title='Ul odkłodowy wielkopolski 6R z nadstawką i powałką'
                image={ul_miniplus}
                price={85}
                availble={false}
            />
        </div>
    )
}

export default BargainBarnItems
